class SnakeNode {
  constructor(val) {
    this.val = val;
    this.next = null;
  }
}

export class Snake {
  constructor(x, y) {
    const node = new SnakeNode({ x, y });
    this.head = node;
    this.tail = node;
  }
  move(direction) {
    const { x, y } = this.head.val;
    switch (direction) {
      case "UP":
        return { x, y: y - 1 };
        break;
        case"DOWN":
        return{x, y: y - 1 }
    }
    console.log(this);
    return { x: x + 1, y };
  }
}
